Initial state (complexity 28): fn authenticate_and_authorize( req: &Request, db: &Database, cache: &Cache
) -> Result<User> { // Validation if req.token.is_empty() { return Err(Error::NoToken); } // Check cache if let Some(cached) = cache.get(&req.token) { if !cached.is_expired() { if cached.user.is_active() { if !cached.user.is_banned() { if cached.user.has_permission(&req.action) { return Ok(cached.user.clone()); } } } } } // Parse token let claims = match jwt::decode(&req.token) { Ok(c) => c, Err(e) => { if e.kind() == jwt::ErrorKind::Expired { return Err(Error::TokenExpired); } else { return Err(Error::InvalidToken); } } }; // Load user let user = db.get_user(claims.user_id)?; // Validate user if !user.is_active() { return Err(Error::UserInactive); } if user.is_banned() { return Err(Error::UserBanned); } if !user.has_permission(&req.action) { return Err(Error::Forbidden); } // Update cache cache.set(&req.token, CachedAuth { user: user.clone(), expires_at: Time::now() + Duration::hours(1) }); Ok(user)
} Refactored (main function complexity 4): fn authenticate_and_authorize( req: &Request, db: &Database, cache: &Cache
) -> Result<User> { validate_request(req)?; if let Some(user) = check_cache(req, cache)? { return Ok(user); } let claims = parse_token(&req.token)?; let user = load_and_validate_user(claims.user_id, &req.action, db)?; update_cache(&req.token, &user, cache); Ok(user)
} fn validate_request(req: &Request) -> Result<()> { if req.token.is_empty() { return Err(Error::NoToken); } Ok(())
} fn check_cache(req: &Request, cache: &Cache) -> Result<Option<User>> { if let Some(cached) = cache.get(&req.token) { if cached.is_expired() { return Ok(None); } validate_user_access(&cached.user, &req.action)?; return Ok(Some(cached.user.clone())); } Ok(None)
} fn parse_token(token: &str) -> Result<Claims> { jwt::decode(token).map_err(|e| { match e.kind() { jwt::ErrorKind::Expired => Error::TokenExpired, _ => Error::InvalidToken } })
} fn load_and_validate_user( user_id: UserId, action: &str, db: &Database
) -> Result<User> { let user = db.get_user(user_id)?; validate_user_access(&user, action)?; Ok(user)
} fn validate_user_access(user: &User, action: &str) -> Result<()> { if !user.is_active() { return Err(Error::UserInactive); } if user.is_banned() { return Err(Error::UserBanned); } if !user.has_permission(action) { return Err(Error::Forbidden); } Ok(())
} fn update_cache(token: &str, user: &User, cache: &Cache) { cache.set(token, CachedAuth { user: user.clone(), expires_at: Time::now() + Duration::hours(1) });
} Result : Main function: 28 → 4 (85% reduction) All helper functions: < 10 complexity Code is testable, readable, maintainable

