1. Line Coverage Definition : Percentage of lines executed by tests Example : fn divide(a: i32, b: i32) -> Result<i32, String> { if b == 0 { // Line 1 ✅ covered return Err("division by zero".into()); // Line 2 ❌ not covered } Ok(a / b) // Line 3 ✅ covered
} #[test]
fn test_divide() { assert_eq!(divide(10, 2), Ok(5)); // Covers lines 1 and 3, not 2
} Line coverage: 66% (2 of 3 lines covered) To hit 100%: add a test for b == 0 case. 2. Branch Coverage Definition : Percentage of decision branches taken by tests Example : fn classify(age: i32) -> &'static str { if age < 18 { "minor" // Branch A } else { "adult" // Branch B }
} #[test]
fn test_classify() { assert_eq!(classify(16), "minor"); // Tests branch A only
} Branch coverage: 50% (1 of 2 branches covered) To hit 100%: add a test for age >= 18 case. 3. Function Coverage Definition : Percentage of functions called by tests Example : fn add(a: i32, b: i32) -> i32 { a + b } // ✅ called by tests
fn multiply(a: i32, b: i32) -> i32 { a * b } // ❌ never called #[test]
fn test_add() { assert_eq!(add(2, 3), 5); // Only tests add()
} Function coverage: 50% (1 of 2 functions covered) 4. Statement Coverage Definition : Percentage of statements executed (similar to line coverage, but counts logical statements, not lines) Example : // One line, two statements
let x = if condition { 5 } else { 10 }; y = x * 2; Line coverage might show 100%, but statement coverage reveals if both statements executed.

