} fn arb_handler_ref() -> impl Strategy<Value = HandlerRef> { "[a-z][a-z0-9_]{2,10}::[a-z][a-z0-9_]{2,10}" .prop_map(|path| HandlerRef { path, inline: None })
} fn arb_param_schema() -> impl Strategy<Value = ParamSchema> { prop::collection::hash_map( "[a-z][a-z0-9_]{2,15}", // Field names arb_simple_type().prop_map(ParamType::Simple), 0..5, // 0-5 fields ) .prop_map(|fields| ParamSchema { fields })
}

