} Edge cases found : Empty strings, special characters, Unicode in names. Property 2: Tool Name Uniqueness Invariant : After validation, all tool names are unique. proptest! { #[test] fn tool_names_unique(config in arb_forge_config()) { let mut names = std::collections::HashSet::new(); for tool in &config.tools { prop_assert!(names.insert(tool.name())); } }
