You can have 100% test coverage and still have ineffective tests: // Production code
pub fn validate_config(config: &ForgeConfig) -> Result<()> { if config.tools.is_empty() { return Err(ConfigError::EmptyTools); } Ok(())
} // Test with 100% line coverage but zero assertions
#[test]
fn test_validate_config() { let config = create_valid_config(); validate_config(&config); // ❌ No assertion! Test passes even if code is broken
} Coverage says : ✅ 100% line coverage Reality : This test catches nothing! Mutation testing finds these weak tests by mutating code and seeing if tests fail.

